Now, I can GIVE! If you need some inspiration, here’s who I am supporting this season:

@adaptivedesigninc an NYC org that designs & builds custom adaptations for individuals with disabilities.

@wfuv the non-commercial radio station that gets my family through every car ride. 

@welcomebabyusa provides low income mothers one box with everything baby needs for their first 4 weeks.

@bergenfamilycenter1898 a local center that grants holiday wishes for those in great need in Bergen County.

